import React, {useState} from 'react';
import './App.css';

const Header = () => {
    return(
       <div className="header">Hello me header</div>
    );
};
const Login = () => {
    return(
       <div className="login">Hello me login</div>
    );
};

export default function App() {
  return (
    <div>
        <div>Hello me app</div>
        <Header />
        <Login />
    </div>
  );
}
